import React from "react";
import "./index.css";

const AramaÇubuğu = (props) => {
  const { AramaÇubuğu, aramaYap } = props;
  return (
    <div className="search-bar-wrapper">
      <form className="search-form">
        <input
          type="text"
          placeholder="Arama"
          value={AramaÇubuğu}
          onChange={(e) => aramaYap(e.target.value)}
        />
      </form>
    </div>
  );
};

export default AramaÇubuğu;
